import React, { Component } from 'react';
import Gallery from 'react-photo-gallery';

class Photos extends Component {
  render() {
    return <Gallery photos={photos} />;
  }
}

const photos = [
  {
    src: './titanic.png',
    width: 300,
    height: 150,
  },
  // {
  //   src: 'http://example.com/example/img2.jpg',
  //   width: 1,
  //   height: 1,
  // },
];

export default Photos;
